import React from 'react'

import Tooltip from '@bit/recharts.recharts.tooltip';
import Pie from '@bit/recharts.recharts.pie';


const data01 = [
    {
      "name": "Mujeres",
      "value": 400
    },
    {
      "name": "Hombres",
      "value": 300
    },
    {
      "name": "No binario",
      "value": 300
    },
    {
      "name": "Otros",
      "value": 200
    }
  ];



export default function CircularGraph() {
  return (
    <PieChart width={400} height={400}>
      <Pie dataKey="value" isAnimationActive={false} data={data01} cx={200} cy={200} outerRadius={80} fill="#8884d8" label />
      <Pie dataKey="value" data={data01} cx={500} cy={200} innerRadius={40} outerRadius={80} fill="#82ca9d" />
      <Tooltip />
    </PieChart>
  );
}
